import MainLayout from "../Layout/MainLayout";

export default function StudentDashboard() {
  return (
    <MainLayout>
      <h2>Student Dashboard</h2>

      <div className="dashboard-grid">
        <div className="card">
          <h3>My Classes</h3>
          <a className="action-btn" href="/classes">View</a>
        </div>
        <div className="card">
          <h3>Assignments</h3>
          <a className="action-btn secondary" href="/assignments">View</a>
        </div>
      </div>
    </MainLayout>
  );
}
